INSERT INTO `markdown` (`id`, `contentHTML`, `contentMarkdown`, `description`, `doctorId`, `specialtyId`, `clinicId`, `createdAt`, `updatedAt`) VALUES
(1, '<p><strong>Chuyên ngành:</strong> Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</p>\n<h3>Học vấn</h3>\n<ul>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</li>\n</ul>\n<h3>Hoạt động</h3>\n<ul>\n<li>Bác sĩ nhận khám từ 16 tuổi trở lên</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học Y dược thành phố Hồ Chí Minh</li>\n<li>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</li>\n<li>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</li>\n<li>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</li>\n</ul>\n<h3>Khám và điều trị</h3>\n<ul>\n<li>Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...</li>\n<li>Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...</li>\n<li>Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...</li>\n<li>Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...</li>\n<li>Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...</li>\n<li>Rối loạn ảo giác</li>\n<li>Các rối loạn liên quan đến stress</li>\n<li>Rối loạn khí sắc</li>\n<li>Rối loạn cảm xúc phân liệt</li>\n<li>Rối loạn đa nhân cách</li>\n<li>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...</li>\n</ul>\n', '\n\n**Chuyên ngành:** Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n\n### Học vấn\n\n- Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n\n### Hoạt động\n\n- Bác sĩ nhận khám từ 16 tuổi trở lên\n\n### Quá trình đào tạo\n\n- Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học Y dược thành phố Hồ Chí Minh\n- Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n- Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n### Quá trình công tác\n\n- Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n- Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n- Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n\n### Khám và điều trị\n\n- Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...\n- Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...\n- Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n- Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n- Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n- Rối loạn ảo giác\n- Các rối loạn liên quan đến stress\n- Rối loạn khí sắc\n- Rối loạn cảm xúc phân liệt\n- Rối loạn đa nhân cách\n- Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...\n', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 1, NULL, NULL, '2023-08-26 16:41:30', '2023-09-18 13:56:34'),
(5, '1242341234', 'fadsfsdfa4312432', 'fafsdafsdfasfadd3241342344', 2, NULL, NULL, '2023-08-27 08:04:46', '2023-08-27 08:04:46'),
(6, '<p><strong>Kinh nghiệm:</strong> 35 năm trong lĩnh vực Cơ xương khớp</p>\n<p><strong>Vị trí hiện tại:</strong> Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1</p>\n<p><strong>Công tác tại các bệnh viện nổi tiếng:</strong> Bệnh viện An Bình, Bệnh viện Trưng Vương, Bệnh viện Nhân dân 115</p>\n<p><strong>Bác sĩ nhận khám từ 15 tuổi trở lên</strong></p>\n<h3>Khám và điều trị</h3>\n<ul>\n<li>Đau thần kinh tọa</li>\n<li>Thoát vị đĩa đệm</li>\n<li>Viêm khớp dạng thấp</li>\n<li>Viêm cột sống dính khớp</li>\n<li>Thoái hóa khớp, cột sống cổ, cột sống thắt lưng</li>\n<li>Viêm quanh khớp vai, điểm bám các gân</li>\n<li>Bệnh loãng xương</li>\n<li>Nội soi các khớp, yếu cơ</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Hiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1</li>\n<li>Bác sĩ, Giám đốc - Bệnh viện Quận 8 (2009 - 2018)</li>\n<li>Bác sĩ, Trưởng khoa - Bệnh viện Trưng Vương (1997 - 2009)</li>\n<li>Bác sĩ, Phó khoa - Bệnh viện Nhân dân 115 (1993 - 1997)</li>\n<li>Bác sĩ - Bệnh viện An Bình (1988 - 1993)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Tiến sĩ Y khoa, Trường Đại học Y Dược TP. Hồ Chí Minh (2018)</li>\n<li>Thạc sĩ Y học, Trường Đại học Y Dược TP. Hồ Chí Minh (2002)</li>\n<li>Tu nghiệp về đánh giá và điều trị đau tại Centre d’Évaluation et de Traitement de la douleur, Hôpital Saint Antoine - Pháp (1993)</li>\n<li>Bác sĩ, Trường Đại học Y Dược TP. Hồ Chí Minh (1987)</li>\n</ul>\n<h3>Sách và các công trình nghiên cứu</h3>\n<p><strong>Chủ nhiệm các đề tài:</strong></p>\n<ul>\n<li>&quot;Tỷ lệ, cơ cấu, và một số yếu tố liên quan đến đau mạn tính ở người dân Việt Nam: nghiên cứu ch Quốc gia với 12.136 người tham gia&quot;, Đồng tác giả, Đăng trên &quot;Tạp chí Nghiên cứu Đau&quot; 2019; 12: 769 - 777; Đăng trực tuyến ngày 25 tháng 2 năm 2019; doi: 10.2147/JPR.S184713</li>\n<li>&quot;Percentage, structure, and factors related to chronic pain in Vietnam: a cross-sectional study of 12,136 respondents&quot;, Đề xuất, Xuất bản trên &quot;Journal of Pain Research&quot; 2019; 12: 769 - 777; Xuất bản trực tuyến ngày 25 tháng 2 năm 2019; doi: 10.2147/JPR.S184713</li>\n</ul>\n', '\n\n**Kinh nghiệm:** 35 năm trong lĩnh vực Cơ xương khớp\n\n**Vị trí hiện tại:** Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1\n\n**Công tác tại các bệnh viện nổi tiếng:** Bệnh viện An Bình, Bệnh viện Trưng Vương, Bệnh viện Nhân dân 115\n\n**Bác sĩ nhận khám từ 15 tuổi trở lên**\n\n### Khám và điều trị\n\n- Đau thần kinh tọa\n- Thoát vị đĩa đệm\n- Viêm khớp dạng thấp\n- Viêm cột sống dính khớp\n- Thoái hóa khớp, cột sống cổ, cột sống thắt lưng\n- Viêm quanh khớp vai, điểm bám các gân\n- Bệnh loãng xương\n- Nội soi các khớp, yếu cơ\n\n### Quá trình công tác\n\n- Hiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1\n- Bác sĩ, Giám đốc - Bệnh viện Quận 8 (2009 - 2018)\n- Bác sĩ, Trưởng khoa - Bệnh viện Trưng Vương (1997 - 2009)\n- Bác sĩ, Phó khoa - Bệnh viện Nhân dân 115 (1993 - 1997)\n- Bác sĩ - Bệnh viện An Bình (1988 - 1993)\n\n### Quá trình đào tạo\n\n- Tiến sĩ Y khoa, Trường Đại học Y Dược TP. Hồ Chí Minh (2018)\n- Thạc sĩ Y học, Trường Đại học Y Dược TP. Hồ Chí Minh (2002)\n- Tu nghiệp về đánh giá và điều trị đau tại Centre d’Évaluation et de Traitement de la douleur, Hôpital Saint Antoine - Pháp (1993)\n- Bác sĩ, Trường Đại học Y Dược TP. Hồ Chí Minh (1987)\n\n### Sách và các công trình nghiên cứu\n\n**Chủ nhiệm các đề tài:**\n\n- \"Tỷ lệ, cơ cấu, và một số yếu tố liên quan đến đau mạn tính ở người dân Việt Nam: nghiên cứu ch Quốc gia với 12.136 người tham gia\", Đồng tác giả, Đăng trên \"Tạp chí Nghiên cứu Đau\" 2019; 12: 769 - 777; Đăng trực tuyến ngày 25 tháng 2 năm 2019; doi: 10.2147/JPR.S184713\n- \"Percentage, structure, and factors related to chronic pain in Vietnam: a cross-sectional study of 12,136 respondents\", Đề xuất, Xuất bản trên \"Journal of Pain Research\" 2019; 12: 769 - 777; Xuất bản trực tuyến ngày 25 tháng 2 năm 2019; doi: 10.2147/JPR.S184713\n', '35 năm kinh nghiệm lĩnh vực Cơ xương khớp\nHiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1\nTừng công tác tại các bệnh viện lớn: Bệnh viện An Bình, Bệnh viện Trưng Vương, Bệnh viện Nhân dân 115\nBác sĩ nhận khám từ 15 tuổi lên', 3, NULL, NULL, '2023-08-30 20:29:51', '2023-09-17 14:34:43'),
(7, '<p><strong>Khám Nam học, Bệnh viện Nam học và Hiếm muộn Hà Nội</strong></p>\n<ul>\n<li>Khám Nam học với các bác sĩ chuyên khoa giỏi, nhiều năm kinh nghiệm.</li>\n<li>Đội ngũ bác sĩ được đào tạo bài bản tại các trường Đại học, Bệnh viện chuyên sâu về vấn đề Nam học.</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<p><strong>Đội ngũ bác sĩ</strong></p>\n<p><em>Lưu ý quan trọng</em></p>\n<ul>\n<li>\n<p>Người bệnh nên đặt lịch trước 17 giờ ngày hôm trước để được ưu tiên trong quá trình đi khám.</p>\n</li>\n<li>\n<p>Nếu đặt lịch và đi khám trong cùng 1 ngày, thời gian chờ khám có thể kéo dài hơn so với khung giờ đã đăng ký.</p>\n</li>\n<li>\n<p>Hiện tại chưa có dịch vụ chọn đích danh bác sĩ thăm khám,người bệnh sẽ được hỗ trợ khám với một trong những bác sĩ dưới đây (tùy thuộc vào lịch khám của bác sĩ trong khung giờ đó):\n<strong>Bác sĩ Chuyên khoa II Nguyễn Khắc Lợi</strong></p>\n</li>\n<li>\n<p>Giám đốc Bệnh viện chuyên khoa Nam học và Hiếm muộn Hà Nội, Uy viên Ban chấp hành Hội Y học giới tính Việt Nam.</p>\n</li>\n<li>\n<p>Nguyên Phó chủ nhiệm khoa Ngoại tiết niệu – Bệnh viện E Hà Nội. Ngoài ra bác sĩ từng công tác tại Bệnh viện Chợ Rẫy, Bệnh viện Thống Nhất thành phố Hồ Chí Minh, Phòng khám Tâm Anh.</p>\n</li>\n<li>\n<p>Chứng chỉ đào tạo chuyên ngành Nam khoa tại Cộng hòa Séc (2015),Chứng chỉ đào tạo chuyên ngành Nam khoa tại Vương quốc Bỉ (2018).</p>\n</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>\n<p>Rối loạn cương dương</p>\n</li>\n<li>\n<p>Rối loạn khoái cảm</p>\n</li>\n<li>\n<p>Rối loạn xuất tinh, không xuất tinh, xuất tinh sớm, xuất tinh ngược dòng</p>\n</li>\n<li>\n<p>Không quan hệ tình dục được</p>\n</li>\n<li>\n<p>Cương cứng liên tục…</p>\n</li>\n<li>\n<p>Những dị tật bẩm sinh Hệ sinh sản</p>\n</li>\n<li>\n<p>Bất thường về nhiễm sắc thể</p>\n</li>\n<li>\n<p>Lưỡng giới</p>\n</li>\n<li>\n<p>Tinh hoàn ẩn, lạc chỗ</p>\n</li>\n<li>\n<p>Dương vật dị dạng vẹo, xoắn, bé, có màng, tụt vào trong, lệch lỗ đái…</p>\n</li>\n<li>\n<p>Bệnh mắc phải của Hệ sinh sản</p>\n</li>\n<li>\n<p>Chấn thương gẫy dương vật</p>\n</li>\n<li>\n<p>Xoắn tinh hoàn</p>\n</li>\n<li>\n<p>Tràn dịch màng tinh hoàn</p>\n</li>\n<li>\n<p>Khối u</p>\n</li>\n<li>\n<p>Viêm nhiễm bộ phận sinh dục…</p>\n</li>\n<li>\n<p>Chữa giãn tĩnh mạch tinh – nguyên nhân hàng đầu của vô sinh nam bằng phương pháp vi phẫu.</p>\n</li>\n</ul>\n<p><img src=\"https://nubacsy.com/wp-content/uploads/2021/06/kham-hiem-muon-o-ha-noi.png\" alt=\"image\"></p>\n', '**Khám Nam học, Bệnh viện Nam học và Hiếm muộn Hà Nội**\n\n* Khám Nam học với các bác sĩ chuyên khoa giỏi, nhiều năm kinh nghiệm.\n* Đội ngũ bác sĩ được đào tạo bài bản tại các trường Đại học, Bệnh viện chuyên sâu về vấn đề Nam học.\n* Bác sĩ nhận khám mọi độ tuổi\n\n**Đội ngũ bác sĩ**\n\n*Lưu ý quan trọng*\n\n*  Người bệnh nên đặt lịch trước 17 giờ ngày hôm trước để được ưu tiên trong quá trình đi khám.\n* Nếu đặt lịch và đi khám trong cùng 1 ngày, thời gian chờ khám có thể kéo dài hơn so với khung giờ đã đăng ký.\n* Hiện tại chưa có dịch vụ chọn đích danh bác sĩ thăm khám,người bệnh sẽ được hỗ trợ khám với một trong những bác sĩ dưới đây (tùy thuộc vào lịch khám của bác sĩ trong khung giờ đó):\n**Bác sĩ Chuyên khoa II Nguyễn Khắc Lợi**\n\n* Giám đốc Bệnh viện chuyên khoa Nam học và Hiếm muộn Hà Nội, Uy viên Ban chấp hành Hội Y học giới tính Việt Nam.\n* Nguyên Phó chủ nhiệm khoa Ngoại tiết niệu – Bệnh viện E Hà Nội. Ngoài ra bác sĩ từng công tác tại Bệnh viện Chợ Rẫy, Bệnh viện Thống Nhất thành phố Hồ Chí Minh, Phòng khám Tâm Anh.\n* Chứng chỉ đào tạo chuyên ngành Nam khoa tại Cộng hòa Séc (2015),Chứng chỉ đào tạo chuyên ngành Nam khoa tại Vương quốc Bỉ (2018).\n\n\n**Khám và điều trị**\n\n*  Rối loạn cương dương\n* Rối loạn khoái cảm\n* Rối loạn xuất tinh, không xuất tinh, xuất tinh sớm, xuất tinh ngược dòng\n* Không quan hệ tình dục được\n* Cương cứng liên tục…\n* Những dị tật bẩm sinh Hệ sinh sản\n\n* Bất thường về nhiễm sắc thể\n* Lưỡng giới\n* Tinh hoàn ẩn, lạc chỗ\n* Dương vật dị dạng vẹo, xoắn, bé, có màng, tụt vào trong, lệch lỗ đái…\n* Bệnh mắc phải của Hệ sinh sản\n\n* Chấn thương gẫy dương vật\n* Xoắn tinh hoàn\n* Tràn dịch màng tinh hoàn\n* Khối u\n* Viêm nhiễm bộ phận sinh dục…\n* Chữa giãn tĩnh mạch tinh – nguyên nhân hàng đầu của vô sinh nam bằng phương pháp vi phẫu.\n\n![image](https://nubacsy.com/wp-content/uploads/2021/06/kham-hiem-muon-o-ha-noi.png)', 'Khám Nam học với các bác sĩ chuyên khoa giỏi, nhiều năm kinh nghiệm\nĐội ngũ bác sĩ được đào tạo bài bản tại các trường Đại học, Bệnh viện chuyên sâu về vấn đề Nam học\nBác sĩ nhận khám mọi độ tuổi', 5, NULL, NULL, '2023-08-30 20:37:45', '2023-09-18 12:02:47'),
(8, '<h1>Giáo sư, Tiến sĩ Đỗ Như Hơn</h1>\n<p><strong>Chức vụ và danh hiệu:</strong></p>\n<ul>\n<li>Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa Mắt</li>\n<li>Chuyên gia đầu ngành về Nhãn khoa</li>\n<li>Nguyên Giám đốc Bệnh viện Mắt Trung ương</li>\n<li>Danh hiệu Thầy thuốc Nhân dân</li>\n</ul>\n<p><strong>Quá trình đào tạo:</strong></p>\n<ul>\n<li>Học hàm Giáo sư (2014)</li>\n<li>Học hàm Phó Giáo sư (2002)</li>\n<li>Tiến sĩ Y khoa, Đại học Y Hà Nội (1992 - 1996)</li>\n<li>Thực tập sinh tại Cộng hòa Pháp (1989 - 1990)</li>\n<li>Bác sĩ Nội trú Chuyên ngành Nhãn khoa, Đại học Y Hà Nội (1978 - 1980)</li>\n<li>Chuyên ngành Nhãn khoa, Đại học Y Hà Nội (1973 - 1978)</li>\n</ul>\n<p><strong>Quá trình công tác:</strong></p>\n<ul>\n<li>Giám đốc Bệnh viện Mắt Trung ương (2007 - 2015)</li>\n<li>Phó khoa Chấn thương, Phó Viện trưởng Viện mắt (2000)</li>\n<li>Bác sĩ Bệnh viện Mắt Trung Ương (1980 - nay)</li>\n</ul>\n<p><strong>Sách và công trình nghiên cứu:</strong></p>\n<ul>\n<li>Đề tài cấp nhà nước: &quot;Ứng dụng kỹ thuật tiên tiến trong điều trị một số bệnh lý nhãn khoa&quot;</li>\n<li>Đề tài cấp Bộ: &quot;Nghiên cứu đào tạo chuyển giao phát triển kỹ thuật dịch kính võng mạc cho một số tỉnh thành phố.&quot;</li>\n<li>Xây dựng bộ giáo trình Nhãn khoa dành cho công tác đào tạo sau đại học: CKI, Nội trú, Cao học và bộ giáo trình Điều dưỡng Nhãn khoa dành cho công tác đào tạo Điều dưỡng chuyên khoa Mắt</li>\n</ul>\n<p><strong>Giải thưởng:</strong></p>\n<ul>\n<li>Thầy thuốc Nhân dân</li>\n</ul>\n<p><strong>Thành viên các Hội khoa học, tổ chức chuyên môn:</strong></p>\n<ul>\n<li>Phó Chủ tịch Ủy ban Quốc gia Phòng chống mù lòa</li>\n</ul>\n<p><strong>Khám và điều trị các loại bệnh mắt:</strong>\n<em>Dịch kính và võng mạc:</em></p>\n<ul>\n<li>Dịch kính võng mạc</li>\n<li>Bong võng mạc</li>\n<li>Thoái hóa võng mạc</li>\n<li>Thoái hóa dịch kính võng mạc</li>\n<li>Bệnh võng mạc đái tháo đường</li>\n<li>Bệnh thoái hóa hoàng điểm tuổi già</li>\n<li>Các bệnh võng mạc trong các bệnh lý toàn thân</li>\n</ul>\n<p><em>Viêm màng bồ đào:</em></p>\n<ul>\n<li>Viêm màng bồ đào</li>\n<li>Viêm nội nhãn</li>\n<li>Xuất huyết dịch kính</li>\n</ul>\n<p><em>Chấn thương:</em></p>\n<ul>\n<li>Chấn thương mắt</li>\n<li>Chấn thương mi</li>\n<li>Chấn thương lệ đạo</li>\n<li>Dị vật kết giác mạc</li>\n<li>Dị vật nội nhãn</li>\n</ul>\n<p><em>Các bệnh lí về mắt:</em></p>\n<ul>\n<li>Mắt hột</li>\n<li>Khám, điều trị bệnh thiên đầu thống (glaucoma)</li>\n<li>Tật khúc xạ</li>\n</ul>\n<p><em>Các loại rối loạn thị giác:</em></p>\n<ul>\n<li>Cận thị</li>\n<li>Nhược thị</li>\n<li>Viễn thị</li>\n<li>Lão thị</li>\n<li>Loạn thị</li>\n</ul>\n<p><em>Các rối loạn khác về mắt:</em></p>\n<ul>\n<li>Hội chứng khô mắt</li>\n<li>Rối loạn ở hốc mắt</li>\n<li>Rối loạn tuyến lệ</li>\n<li>Tăng nhãn áp</li>\n</ul>\n<p><em>Các bệnh lí khác về mắt:</em></p>\n<ul>\n<li>Quặm mi</li>\n<li>Sa mí mắt</li>\n<li>Viêm kết mạc</li>\n<li>Lác mắt</li>\n<li>Mộng thịt</li>\n<li>Song thị</li>\n<li>Viêm giác mạc</li>\n<li>Viêm mi mắt</li>\n<li>Bong võng mạc</li>\n<li>Rách võng mạc</li>\n<li>Đục thủy tinh thể</li>\n</ul>\n<p><strong>Thủ thuật:</strong></p>\n<ul>\n<li>Lấy sạn vôi kết mạc</li>\n<li>Thông lệ đạo 1 mắt</li>\n<li>Tiêm cạnh nhãn cầu</li>\n<li>Khâu kết mạc</li>\n<li>Khâu vết thương da mi</li>\n</ul>\n', '# Giáo sư, Tiến sĩ Đỗ Như Hơn\n\n**Chức vụ và danh hiệu:**\n- Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa Mắt\n- Chuyên gia đầu ngành về Nhãn khoa\n- Nguyên Giám đốc Bệnh viện Mắt Trung ương\n- Danh hiệu Thầy thuốc Nhân dân\n\n**Quá trình đào tạo:**\n- Học hàm Giáo sư (2014)\n- Học hàm Phó Giáo sư (2002)\n- Tiến sĩ Y khoa, Đại học Y Hà Nội (1992 - 1996)\n- Thực tập sinh tại Cộng hòa Pháp (1989 - 1990)\n- Bác sĩ Nội trú Chuyên ngành Nhãn khoa, Đại học Y Hà Nội (1978 - 1980)\n- Chuyên ngành Nhãn khoa, Đại học Y Hà Nội (1973 - 1978)\n\n**Quá trình công tác:**\n- Giám đốc Bệnh viện Mắt Trung ương (2007 - 2015)\n- Phó khoa Chấn thương, Phó Viện trưởng Viện mắt (2000)\n- Bác sĩ Bệnh viện Mắt Trung Ương (1980 - nay)\n\n**Sách và công trình nghiên cứu:**\n- Đề tài cấp nhà nước: \"Ứng dụng kỹ thuật tiên tiến trong điều trị một số bệnh lý nhãn khoa\"\n- Đề tài cấp Bộ: \"Nghiên cứu đào tạo chuyển giao phát triển kỹ thuật dịch kính võng mạc cho một số tỉnh thành phố.\"\n- Xây dựng bộ giáo trình Nhãn khoa dành cho công tác đào tạo sau đại học: CKI, Nội trú, Cao học và bộ giáo trình Điều dưỡng Nhãn khoa dành cho công tác đào tạo Điều dưỡng chuyên khoa Mắt\n\n**Giải thưởng:**\n- Thầy thuốc Nhân dân\n\n**Thành viên các Hội khoa học, tổ chức chuyên môn:**\n- Phó Chủ tịch Ủy ban Quốc gia Phòng chống mù lòa\n\n**Khám và điều trị các loại bệnh mắt:**\n*Dịch kính và võng mạc:*\n- Dịch kính võng mạc\n- Bong võng mạc\n- Thoái hóa võng mạc\n- Thoái hóa dịch kính võng mạc\n- Bệnh võng mạc đái tháo đường\n- Bệnh thoái hóa hoàng điểm tuổi già\n- Các bệnh võng mạc trong các bệnh lý toàn thân\n\n*Viêm màng bồ đào:*\n- Viêm màng bồ đào\n- Viêm nội nhãn\n- Xuất huyết dịch kính\n\n*Chấn thương:*\n- Chấn thương mắt\n- Chấn thương mi\n- Chấn thương lệ đạo\n- Dị vật kết giác mạc\n- Dị vật nội nhãn\n\n*Các bệnh lí về mắt:*\n- Mắt hột\n- Khám, điều trị bệnh thiên đầu thống (glaucoma)\n- Tật khúc xạ\n\n*Các loại rối loạn thị giác:*\n- Cận thị\n- Nhược thị\n- Viễn thị\n- Lão thị\n- Loạn thị\n\n*Các rối loạn khác về mắt:*\n- Hội chứng khô mắt\n- Rối loạn ở hốc mắt\n- Rối loạn tuyến lệ\n- Tăng nhãn áp\n\n*Các bệnh lí khác về mắt:*\n- Quặm mi\n- Sa mí mắt\n- Viêm kết mạc\n- Lác mắt\n- Mộng thịt\n- Song thị\n- Viêm giác mạc\n- Viêm mi mắt\n- Bong võng mạc\n- Rách võng mạc\n- Đục thủy tinh thể\n\n**Thủ thuật:**\n- Lấy sạn vôi kết mạc\n- Thông lệ đạo 1 mắt\n- Tiêm cạnh nhãn cầu\n- Khâu kết mạc\n- Khâu vết thương da mi\n', 'Nguyên Giám đốc Bệnh viện Mắt Trung ương\nĐược phong tặng Danh hiệu Thầy thuốc Nhân dân', 6, NULL, NULL, '2023-08-31 15:43:01', '2023-08-31 15:43:01'),
(9, '<h1>PGS, TS, Giảng viên cao cấp Trần Hữu Bình</h1>\n<p><strong>Danh hiệu và chức vụ:</strong></p>\n<ul>\n<li>Thầy thuốc Nhân dân</li>\n<li>Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh</li>\n<li>Nguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai</li>\n<li>Nguyên Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội</li>\n</ul>\n<p><strong>Thông tin khám bệnh:</strong></p>\n<ul>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n<li>Bác sĩ không nhận khám tự kỉ và chậm nói</li>\n</ul>\n<p><strong>Quá trình công tác:</strong></p>\n<ul>\n<li>PGS.TS.BS Khám bệnh tại Trung tâm Y khoa số 1, Bệnh viện Đại học Y Hà Nội</li>\n<li>Chủ trì Hội chẩn lâm sàng bệnh nhân Tâm thần tại Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai</li>\n<li>Đào tạo (giảng dạy, hướng dẫn, chấm luận án) Tiến sĩ, Thạc sĩ, Bác sĩ chuyên khoa II, Bác sĩ nội trú chuyên ngành Tâm thần, Y tế công cộng của Trường Đại học Y Hà Nội</li>\n<li>Viện trưởng Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2008 – 2011)</li>\n<li>Trưởng khoa điều trị Nghiện chất Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2010 – 2014)</li>\n<li>Trưởng khoa điều trị loạn thần Nam Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (1995 – 2008)</li>\n<li>Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1995 - 2014)</li>\n<li>Bác sĩ – cán bộ giảng dạy, Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1978 - 1994)</li>\n</ul>\n<p><strong>Quá trình đào tạo:</strong></p>\n<ul>\n<li>Giảng viên cao cấp chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2014)</li>\n<li>Phó Giáo sư chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2007)</li>\n<li>Tiến sĩ chuyên ngành Tâm thần, Trường Đại học Y Hà Nội (2003)</li>\n</ul>\n<p><strong>Sách và công trình nghiên cứu khoa học:</strong></p>\n<ul>\n<li>Tham gia biên soạn chủ biên và đồng chủ biên 16 đầu sách giáo trình giảng dạy, sách chuyên khảo chuyên ngành Tâm thần học và y học (2003 - 2018)</li>\n<li>Trên 50 công trình nghiên cứu khoa học đăng tải trong các tạp chí khoa học uy tín (Tạp chí Nghiên cứu khoa học Đại học Y Hà Nội, tạp chí Tổng hội Y Dược học Việt Nam, tạp chí Y học thực hành Bộ Y tế, tạp chí Hội Tâm thần học Việt Nam) (1992 - 2020)</li>\n<li>Hướng dẫn bảo vệ thành công 31 luận án Tiến sĩ, luận văn Thạc sĩ, Bác sĩ chuyên khoa cấp 2, Bác sĩ nội trú Bệnh viện, Y tế công cộng Đại học Y Hà Nội (2003 - 2020)</li>\n</ul>\n<p><strong>Thành viên các hội khoa học, tổ chức chuyên môn:</strong></p>\n<ul>\n<li>Ban chấp hành Hội Tâm thần học Việt Nam</li>\n<li>Phó Chủ tịch Hội đồng khoa học Viện Nghiên cứu Điều trị các bệnh hiểm nghèo</li>\n</ul>\n<p><strong>Khám và điều trị:</strong>\nBác sĩ nhận khám và điều trị các vấn đề sau:</p>\n<ul>\n<li>Các rối loạn giấc ngủ: Mất ngủ, ngủ nhiều, ác mộng, hoảng sợ khi ngủ, rối loạn nhịp thức ngủ, đi trong giấc ngủ (chứng miên hành).</li>\n<li>Các rối loạn liên quan đến Stress và dạng cơ thể: Đau dai dẳng các loại, rối loạn thần kinh thực vật, rối loạn hệ thống tim mạch, rối loạn dạ dày - ruột, rối loạn hệ thống hô hấp, rối loạn hệ thống tiết niệu - sinh dục.</li>\n<li>Rối loạn sự thích ứng: Trầm cảm, lo âu, rối loạn cảm xúc và hành vi, các rối loạn cảm xúc, các rối loạn tâm ký nặng, rối loạn ở trẻ em và người già.</li>\n<li>Các vấn đề tâm lý ở phụ nữ các giai đoạn: Dậy thì, mang thai, sinh đẻ, mãn kinh.</li>\n<li>Rối loạn ăn uống và rối loạn tình dục.</li>\n<li>Các vấn đề về nghiện: Nghiện rượu, ma tuý, Game Online, Internet, ...</li>\n</ul>\n', '# PGS, TS, Giảng viên cao cấp Trần Hữu Bình\n\n**Danh hiệu và chức vụ:**\n- Thầy thuốc Nhân dân\n- Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh\n- Nguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai\n- Nguyên Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội\n\n**Thông tin khám bệnh:**\n- Bác sĩ nhận khám mọi độ tuổi\n- Bác sĩ không nhận khám tự kỉ và chậm nói\n\n**Quá trình công tác:**\n- PGS.TS.BS Khám bệnh tại Trung tâm Y khoa số 1, Bệnh viện Đại học Y Hà Nội\n- Chủ trì Hội chẩn lâm sàng bệnh nhân Tâm thần tại Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai\n- Đào tạo (giảng dạy, hướng dẫn, chấm luận án) Tiến sĩ, Thạc sĩ, Bác sĩ chuyên khoa II, Bác sĩ nội trú chuyên ngành Tâm thần, Y tế công cộng của Trường Đại học Y Hà Nội\n- Viện trưởng Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2008 – 2011)\n- Trưởng khoa điều trị Nghiện chất Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2010 – 2014)\n- Trưởng khoa điều trị loạn thần Nam Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (1995 – 2008)\n- Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1995 - 2014)\n- Bác sĩ – cán bộ giảng dạy, Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1978 - 1994)\n\n**Quá trình đào tạo:**\n- Giảng viên cao cấp chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2014)\n- Phó Giáo sư chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2007)\n- Tiến sĩ chuyên ngành Tâm thần, Trường Đại học Y Hà Nội (2003)\n\n**Sách và công trình nghiên cứu khoa học:**\n- Tham gia biên soạn chủ biên và đồng chủ biên 16 đầu sách giáo trình giảng dạy, sách chuyên khảo chuyên ngành Tâm thần học và y học (2003 - 2018)\n- Trên 50 công trình nghiên cứu khoa học đăng tải trong các tạp chí khoa học uy tín (Tạp chí Nghiên cứu khoa học Đại học Y Hà Nội, tạp chí Tổng hội Y Dược học Việt Nam, tạp chí Y học thực hành Bộ Y tế, tạp chí Hội Tâm thần học Việt Nam) (1992 - 2020)\n- Hướng dẫn bảo vệ thành công 31 luận án Tiến sĩ, luận văn Thạc sĩ, Bác sĩ chuyên khoa cấp 2, Bác sĩ nội trú Bệnh viện, Y tế công cộng Đại học Y Hà Nội (2003 - 2020)\n\n**Thành viên các hội khoa học, tổ chức chuyên môn:**\n- Ban chấp hành Hội Tâm thần học Việt Nam\n- Phó Chủ tịch Hội đồng khoa học Viện Nghiên cứu Điều trị các bệnh hiểm nghèo\n\n**Khám và điều trị:**\nBác sĩ nhận khám và điều trị các vấn đề sau:\n- Các rối loạn giấc ngủ: Mất ngủ, ngủ nhiều, ác mộng, hoảng sợ khi ngủ, rối loạn nhịp thức ngủ, đi trong giấc ngủ (chứng miên hành).\n- Các rối loạn liên quan đến Stress và dạng cơ thể: Đau dai dẳng các loại, rối loạn thần kinh thực vật, rối loạn hệ thống tim mạch, rối loạn dạ dày - ruột, rối loạn hệ thống hô hấp, rối loạn hệ thống tiết niệu - sinh dục.\n- Rối loạn sự thích ứng: Trầm cảm, lo âu, rối loạn cảm xúc và hành vi, các rối loạn cảm xúc, các rối loạn tâm ký nặng, rối loạn ở trẻ em và người già.\n- Các vấn đề tâm lý ở phụ nữ các giai đoạn: Dậy thì, mang thai, sinh đẻ, mãn kinh.\n- Rối loạn ăn uống và rối loạn tình dục.\n- Các vấn đề về nghiện: Nghiện rượu, ma tuý, Game Online, Internet, ...\n\n', 'Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh\nNguyên Viện trưởng Viện Sức khỏe Tâm thần quốc gia, Bệnh viện Bạch Mai\nNguyên Phó Chủ nhiệm Bộ môn Tâm thần trường Đại học Y Hà Nội\nBác sĩ nhận khám mọi độ tuổi\nBác sĩ không nhận khám tự kỉ và chậm nói', 8, NULL, NULL, '2023-08-31 15:45:36', '2023-08-31 15:45:36'),
(10, '<p>Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Duy Hưng\nPhó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu\nBác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\nNguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\nĐạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan\nBác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu\nHội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới\nGiảng viên bộ môn Da liễu tại Đại Học Y Hà Nội\nTrưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ\nTốt nghiệp Đại học Y Hà Nội (1977)\nNguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam\nPhó Giáo sư khám và điều trị\nCác bệnh lý về chuyên sâu về da liễu người lớn và trẻ em</p>\n<p>Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)\nĐiều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá\nCác bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da\nNám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm\nViêm da cơ địa trẻ em và người lớn\nViêm da dị ứng, viêm da tiếp xúc, viêm da dầu\nTổ đỉa\nMày đay\nBạch biến\nVảy nến\nRụng tóc\nCác bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ\nZona, Thủy đậu, Herpes\nGhẻ\nCác bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc\nViêm mao mạch dị ứng\ncác bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc\nU lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã\nMột số bệnh lông - tóc - móng\nChăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi\nTiêm tái sinh nang tóc\nVà các bệnh lý chuyên sâu khác về chuyên khoa Da liễu</p>\n', 'Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Duy Hưng\nPhó giáo sư, T