(18, '<h2>Bác sĩ Chuyên khoa II Nguyễn Thị Kim Loan</h2>\n<ul>\n<li>Nguyên Trưởng khoa Cơ Xương Khớp và Nội tổng hợp Bệnh viện E Hà Nội</li>\n<li>Được phong tặng Danh hiệu thầy thuốc Ưu tú</li>\n<li>Từng là thực tập sinh tại Ucraina</li>\n<li>Bác sĩ khám cho người bệnh từ 16 tuổi trở lên</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Tốt nghiệp Đại học Y Hà Nội (1970)</li>\n<li>Tốt nghiệp Bác sĩ Chuyên khoa II, Học viện Quân Y (1997)</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Làm việc tại khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội</li>\n<li>Nguyên Trưởng khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội</li>\n</ul>\n<h3>Giải thưởng</h3>\n<ul>\n<li>Danh hiệu thầy thuốc Ưu tú</li>\n<li>Chiến sĩ thi đua ngành y tế</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<p><strong>Bệnh về Khớp</strong></p>\n<ul>\n<li>Gout, Viêm cột sống dính khớp, thoái hóa khớp, viêm khoanh khớp vai</li>\n<li>Đau khớp vai, đau vai gáy, Lupus ban đỏ, đau thắt lưng, đau xương khớp</li>\n<li>Thoát vị đĩa đệm, viêm khớp</li>\n</ul>\n<p><strong>Bệnh về Xương</strong></p>\n<ul>\n<li>Loãng xương, đau nhức xương</li>\n<li>Viêm xương, gai xương, vôi hóa cột sống</li>\n<li>Chấn thương thể thao</li>\n</ul>\n<p><strong>Bệnh về Cơ</strong></p>\n<ul>\n<li>Chứng đau mỏi cơ</li>\n<li>Yếu cơ, Loạn dưỡng cơ</li>\n<li>Viêm cơ, Teo cơ</li>\n</ul>\n<p><strong>Các triệu chứng - biểu hiện sau:</strong></p>\n<ul>\n<li>Thoái hóa khớp (khớp gối, cột sống thắt lưng, cột sống cổ)</li>\n<li>Loãng xương</li>\n<li>Đau vai gáy, Đau thắt lưng, Đau gối, Đau háng, Đau cột sống cổ, Đau hông</li>\n<li>Đau cổ chân, Đau khủy tay, Đau bàn tay, cổ tay, Đau các ngón tay</li>\n<li>Đau khớp thái dương hàm</li>\n<li>Đau lưng, Đau vai, Đau các ngón chân, Đau cổ chân, bàn chân</li>\n<li>Đau thần kinh tọa</li>\n<li>Thoát vị đĩa đệm cột sống cổ, cột sống thắt lưng</li>\n<li>Đau cánh tay</li>\n<li>Hội chứng vai tay, Hội chứng cổ vai cánh tay</li>\n<li>Đau thần kinh liên sườn, Đau ngực, Đau sụn ức sườn, Viêm sụn ức sườn, Đau bả vai</li>\n<li>Bệnh Gout</li>\n<li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li>\n<li>Đau nhiều khớp</li>\n<li>Hoại tử vô khuẩn chỏm xương đùi, Hoại tử vô mạch</li>\n<li>Đau xương bánh chè</li>\n<li>Luput ban đỏ hệ thống, Lulus ban đỏ hệ thống</li>\n<li>Xơ cứng bì toàn thân</li>\n<li>Viêm đa cơ, Viêm da cơ, tổn thương da</li>\n<li>Viêm khớp vùng chậu</li>\n<li>Viêm khớp thiếu niên (đi khập khiễng)</li>\n<li>Viêm khớp nhiễm khuẩn</li>\n<li>Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)</li>\n<li>Viêm cột sống dính khớp</li>\n<li>Loạn dưỡng cơ tiến triển</li>\n</ul>\n', '## Bác sĩ Chuyên khoa II Nguyễn Thị Kim Loan\n\n- Nguyên Trưởng khoa Cơ Xương Khớp và Nội tổng hợp Bệnh viện E Hà Nội\n- Được phong tặng Danh hiệu thầy thuốc Ưu tú\n- Từng là thực tập sinh tại Ucraina\n- Bác sĩ khám cho người bệnh từ 16 tuổi trở lên\n\n### Quá trình đào tạo\n\n- Tốt nghiệp Đại học Y Hà Nội (1970)\n- Tốt nghiệp Bác sĩ Chuyên khoa II, Học viện Quân Y (1997)\n\n### Quá trình công tác\n\n- Làm việc tại khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội\n- Nguyên Trưởng khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội\n\n### Giải thưởng\n\n- Danh hiệu thầy thuốc Ưu tú\n- Chiến sĩ thi đua ngành y tế\n\n## Khám và điều trị\n\n**Bệnh về Khớp**\n\n- Gout, Viêm cột sống dính khớp, thoái hóa khớp, viêm khoanh khớp vai\n- Đau khớp vai, đau vai gáy, Lupus ban đỏ, đau thắt lưng, đau xương khớp\n- Thoát vị đĩa đệm, viêm khớp\n\n**Bệnh về Xương**\n\n- Loãng xương, đau nhức xương\n- Viêm xương, gai xương, vôi hóa cột sống\n- Chấn thương thể thao\n\n**Bệnh về Cơ**\n\n- Chứng đau mỏi cơ\n- Yếu cơ, Loạn dưỡng cơ\n- Viêm cơ, Teo cơ\n\n**Các triệu chứng - biểu hiện sau:**\n\n- Thoái hóa khớp (khớp gối, cột sống thắt lưng, cột sống cổ)\n- Loãng xương\n- Đau vai gáy, Đau thắt lưng, Đau gối, Đau háng, Đau cột sống cổ, Đau hông\n- Đau cổ chân, Đau khủy tay, Đau bàn tay, cổ tay, Đau các ngón tay\n- Đau khớp thái dương hàm\n- Đau lưng, Đau vai, Đau các ngón chân, Đau cổ chân, bàn chân\n- Đau thần kinh tọa\n- Thoát vị đĩa đệm cột sống cổ, cột sống thắt lưng\n- Đau cánh tay\n- Hội chứng vai tay, Hội chứng cổ vai cánh tay\n- Đau thần kinh liên sườn, Đau ngực, Đau sụn ức sườn, Viêm sụn ức sườn, Đau bả vai\n- Bệnh Gout\n- Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n- Đau nhiều khớp\n- Hoại tử vô khuẩn chỏm xương đùi, Hoại tử vô mạch\n- Đau xương bánh chè\n- Luput ban đỏ hệ thống, Lulus ban đỏ hệ thống\n- Xơ cứng bì toàn thân\n- Viêm đa cơ, Viêm da cơ, tổn thương da\n- Viêm khớp vùng chậu\n- Viêm khớp thiếu niên (đi khập khiễng)\n- Viêm khớp nhiễm khuẩn\n- Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)\n- Viêm cột sống dính khớp\n- Loạn dưỡng cơ tiến triển\n', 'Nguyên Trưởng khoa Cơ xương khớp, Bệnh viện E Hà Nội\nĐược phong tặng Danh hiệu Thầy thuốc Ưu tú\nBác sĩ khám cho người bệnh từ 16 tuổi trở lên', 22, NULL, NULL, '2023-09-18 13:59:03', '2023-09-18 19:58:54'),
(19, '<h2>Bác sĩ Chuyên khoa II Võ Văn Mẫn</h2>\n<ul>\n<li>Trưởng khoa Chấn thương Chỉnh hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn.</li>\n<li>25 năm kinh nghiệm về Ngoại Chấn thương Chỉnh hình</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Trưởng khoa Chấn Thương Chỉnh Hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn (Tháng 8/2020 – Nay)</li>\n<li>Trưởng khoa Chấn Thương Chỉnh Hình, Bệnh viện Sài Gòn ITO (2005 – 2020)</li>\n<li>Bác sĩ điều trị Bệnh viện cấp cứu Trưng Vương (2003 – 2005)</li>\n<li>Trưởng khoa Chấn Thương Chỉnh Hình – Bệnh viện Sài Gòn ITO (2001 – 2003)</li>\n<li>Bác sĩ điều trị tại Bệnh viện Chợ Rẫy (1996 - 2001)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Bác sĩ chuyên khoa II chấn thương chỉnh hình, Đại học Y khoa Phạm Ngọc Thạch (2013 – 2015)</li>\n<li>Bác sĩ chuyên khoa I chấn thương chỉnh hình, Đại học Y Dược TP.HCM (1999 – 2001)</li>\n<li>Đại học Y khoa, Đại học Tây Nguyên (1986 – 1992)</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<ul>\n<li>Phẫu thuật cột sống</li>\n<li>Thay khớp háng – khớp gối nhân tạo</li>\n<li>Nội soi khớp</li>\n<li>Kết hợp xương</li>\n</ul>\n', '## Bác sĩ Chuyên khoa II Võ Văn Mẫn\n\n- Trưởng khoa Chấn thương Chỉnh hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn.\n- 25 năm kinh nghiệm về Ngoại Chấn thương Chỉnh hình\n- Bác sĩ nhận khám mọi độ tuổi\n\n### Quá trình công tác\n\n- Trưởng khoa Chấn Thương Chỉnh Hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn (Tháng 8/2020 – Nay)\n- Trưởng khoa Chấn Thương Chỉnh Hình, Bệnh viện Sài Gòn ITO (2005 – 2020)\n- Bác sĩ điều trị Bệnh viện cấp cứu Trưng Vương (2003 – 2005)\n- Trưởng khoa Chấn Thương Chỉnh Hình – Bệnh viện Sài Gòn ITO (2001 – 2003)\n- Bác sĩ điều trị tại Bệnh viện Chợ Rẫy (1996 - 2001)\n\n### Quá trình đào tạo\n\n- Bác sĩ chuyên khoa II chấn thương chỉnh hình, Đại học Y khoa Phạm Ngọc Thạch (2013 – 2015)\n- Bác sĩ chuyên khoa I chấn thương chỉnh hình, Đại học Y Dược TP.HCM (1999 – 2001)\n- Đại học Y khoa, Đại học Tây Nguyên (1986 – 1992)\n\n## Khám và điều trị\n\n- Phẫu thuật cột sống\n- Thay khớp háng – khớp gối nhân tạo\n- Nội soi khớp\n- Kết hợp xương\n', 'Trưởng khoa Chấn thương Chỉnh hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn\n25 năm kinh nghiệm về Ngoại Chấn thương Chỉnh hình\nBác sĩ nhận khám mọi độ tuổi', 31, NULL, NULL, '2023-09-18 14:00:43', '2023-09-18 20:12:51'),
