khoa, Đại học Tây Nguyên (1986 – 1992)\n\n## Khám và điều trị\n\n- Phẫu thuật cột sống\n- Thay khớp háng – khớp gối nhân tạo\n- Nội soi khớp\n- Kết hợp xương\n', 'Trưởng khoa Chấn thương Chỉnh hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn\n25 năm kinh nghiệm về Ngoại Chấn thương Chỉnh hình\nBác sĩ nhận khám mọi độ tuổi', 31, NULL, NULL, '2023-09-18 14:00:55', '2023-09-18 14:00:55'),
(21, '<h2>Bác sĩ Chuyên khoa I Lý Na Rương</h2>\n<ul>\n<li>Gần 20 năm kinh nghiệm chuyên sâu về bệnh lý cơ xương khớp</li>\n<li>Chứng chỉ Phẫu thuật bàn tay, Kỹ thuật thay khớp háng - khớp gối toàn phần thế hệ mới cùng với những tiến bộ mới trong điều trị chấn thương và chỉnh hình tại Đài Loan &amp; Việt Nam.</li>\n</ul>\n<h3>Khám và điều trị</h3>\n<ul>\n<li>Viêm đa khớp dạng thấp</li>\n<li>Viêm cột sống dính khớp</li>\n<li>Thoát vị đĩa đệm</li>\n<li>Trượt cột sống</li>\n<li>Gout, loãng xương</li>\n<li>Thoái hóa khớp</li>\n<li>Viêm chu vai</li>\n<li>Viêm lồi cầu khuỷu tay</li>\n<li>Viêm bao gân cổ tay</li>\n<li>Hội chứng ống cổ tay</li>\n<li>Viêm gân gan chân</li>\n<li>Các chấn thương thể thao, …</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Bác sĩ chuyên khoa ngoại - chấn thương chỉnh hình tại Phòng Khám Đa khoa SIM MED (2021 - nay)</li>\n<li>Giám đốc chuyên môn kiêm phụ trách chuyên khoa ngoại - chấn thương chỉnh hình tại Phòng khám Đa khoa Thánh Mẫu (2017 - 2021)</li>\n<li>Bác sĩ chuyên khoa ngoại - chấn thương chỉnh hình tại Phòng Khám Đa khoa Thánh Mẫu (2010 - 2017)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Bác sĩ chuyên khoa I chấn thương chỉnh hình tại Đại học Y Dược TP. HCM (2008 - 2010)</li>\n<li>Bác sĩ đa khoa tại Đại học Y Dược TP. HCM (1999 - 2005)</li>\n</ul>\n<h3>Chứng chỉ trong và ngoài nước</h3>\n<ul>\n<li>Chứng chỉ Phẫu thuật bàn tay, Kỹ thuật thay khớp háng - khớp gối toàn phần thế hệ mới cùng với những tiến bộ mới trong điều trị chấn thương và chỉnh hình tại Đài Loan &amp; Việt Nam.</li>\n<li>Chứng chỉ sơ bộ chẩn đoán hình ảnh tại Bệnh Viện Chợ Rẫy.</li>\n<li>Chứng chỉ Tiêm khớp và tiêm bao gân tại Đại Học Y Dược TP. HCM.</li>\n</ul>\n', '## Bác sĩ Chuyên khoa I Lý Na Rương\n\n- Gần 20 năm kinh nghiệm chuyên sâu về bệnh lý cơ xương khớp\n- Chứng chỉ Phẫu thuật bàn tay, Kỹ thuật thay khớp háng - khớp gối toàn phần thế hệ mới cùng với những tiến bộ mới trong điều trị chấn thương và chỉnh hình tại Đài Loan & Việt Nam.\n\n### Khám và điều trị\n\n- Viêm đa khớp dạng thấp\n- Viêm cột sống dính khớp\n- Thoát vị đĩa đệm\n- Trượt cột sống\n- Gout, loãng xương\n- Thoái hóa khớp\n- Viêm chu vai\n- Viêm lồi cầu khuỷu tay\n- Viêm bao gân cổ tay\n- Hội chứng ống cổ tay\n- Viêm gân gan chân\n- Các chấn thương thể thao, …\n\n### Quá trình công tác\n\n- Bác sĩ chuyên khoa ngoại - chấn thương chỉnh hình tại Phòng Khám Đa khoa SIM MED (2021 - nay)\n- Giám đốc chuyên môn kiêm phụ trách chuyên khoa ngoại - chấn thương chỉnh hình tại Phòng khám Đa khoa Thánh Mẫu (2017 - 2021)\n- Bác sĩ chuyên khoa ngoại - chấn thương chỉnh hình tại Phòng Khám Đa khoa Thánh Mẫu (2010 - 2017)\n\n### Quá trình đào tạo\n\n- Bác sĩ chuyên khoa I chấn thương chỉnh hình tại Đại học Y Dược TP. HCM (2008 - 2010)\n- Bác sĩ đa khoa tại Đại học Y Dược TP. HCM (1999 - 2005)\n\n### Chứng chỉ trong và ngoài nước\n\n- Chứng chỉ Phẫu thuật bàn tay, Kỹ thuật thay khớp háng - khớp gối toàn phần thế hệ mới cùng với những tiến bộ mới trong điều trị chấn thương và chỉnh hình tại Đài Loan & Việt Nam.\n- Chứng chỉ sơ bộ chẩn đoán hình ảnh tại Bệnh Viện Chợ Rẫy.\n- Chứng chỉ Tiêm khớp và tiêm bao gân tại Đại Học Y Dược TP. HCM.\n', 'Gần 20 năm kinh nghiệm chuyên sâu về bệnh lý cơ xương khớp\nChứng chỉ Phẫu thuật bàn tay, Kỹ thuật thay khớp háng - khớp gối toàn phần thế hệ mới cùng với những tiến bộ mới trong điều trị chấn thương và chỉnh hình tại Đài Loan & Việt Nam.', 32, NULL, NULL, '2023-09-18 14:05:32', '2023-10-17 13:34:40'),
(22, '<h2>Bác sĩ Joseph Fredrick Rogge</h2>\n<ul>\n<li>Gần 20 năm kinh nghiệm trong trị liệu Chiropractic</li>\n<li>Giám đốc sáng lập và điều hành Phòng khám Rogge Chiropractic tại Bệnh viện Veterans Health Administration, Hoa Kỳ</li>\n<li>Thành viên Hiệp Hội Chiropractic Hoa Kỳ</li>\n</ul>\n<h3>Khám và điều trị</h3>\n<ul>\n<li>Tầm soát xương khớp</li>\n<li>Thoát vị đĩa đệm</li>\n<li>Cong vẹo cột sống</li>\n<li>Đau lưng</li>\n<li>Hội chứng ống cổ tay</li>\n<li>Thoái hóa khớp gối</li>\n<li>Tràn dịch khớp gối</li>\n<li>Thoái hóa cột sống</li>\n<li>Chấn thương thể thao</li>\n<li>Đau cổ vai gáy</li>\n<li>Tê bì chân tay</li>\n<li>Đau thần kinh tọa</li>\n<li>Viêm đau khớp gối</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Giám đốc sáng lập và điều hành Phòng khám Rogge Chiropractic tại Bệnh viện Veterans Health Administration, Hoa Kỳ</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Tốt nghiệp chuyên ngành Chiropractic tại trường đại jojc Palmer, Hoa Kỳ</li>\n</ul>\n<h3>Thành viên các Hội khoa học, tổ chức chuyên môn</h3>\n<ul>\n<li>Thành viên Hiệp Hội Chiropractic Hoa Kỳ</li>\n</ul>\n', '## Bác sĩ Joseph Fredrick Rogge\n\n- Gần 20 năm kinh nghiệm trong trị liệu Chiropractic\n- Giám đốc sáng lập và điều hành Phòng khám Rogge Chiropractic tại Bệnh viện Veterans Health Administration, Hoa Kỳ\n- Thành viên Hiệp Hội Chiropractic Hoa Kỳ\n\n### Khám và điều trị\n\n- Tầm soát xương khớp\n- Thoát vị đĩa đệm\n- Cong vẹo cột sống\n- Đau lưng\n- Hội chứng ống cổ tay\n- Thoái hóa khớp gối\n- Tràn dịch khớp gối\n- Thoái hóa cột sống\n- Chấn thương thể thao\n- Đau cổ vai gáy\n- Tê bì chân tay\n- Đau thần kinh tọa\n- Viêm đau khớp gối\n\n### Quá trình công tác\n\n- Giám đốc sáng lập và điều hành Phòng khám Rogge Chiropractic tại Bệnh viện Veterans Health Administration, Hoa Kỳ\n\n### Quá trình đào tạo\n\n- Tốt nghiệp chuyên ngành Chiropractic tại trường đại jojc Palmer, Hoa Kỳ\n\n### Thành viên các Hội khoa học, tổ chức chuyên môn\n\n- Thành viên Hiệp Hội Chiropractic Hoa Kỳ\n', 'Gần 20 năm kinh nghiệm trong trị liệu Chiropractic\nGiám đốc sáng lập và điều hành Phòng khám Rogge Chiropractic tại Bệnh viện Veterans Health Administration, Hoa Kỳ\nThành viên Hiệp Hội Chiropractic Hoa Kỳ', 30, NULL, NULL, '2023-09-18 14:13:15', '2023-09-18 14:13:15'),
(23, '<h2>Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Vĩnh Ngọc</h2>\n<ul>\n<li>Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Vĩnh Ngọc hiện đang là Phó Chủ tịch Hội khớp học Hà Nội</li>\n<li>Trưởng phân môn khớp - Phó Trưởng bộ môn Nội tổng hợp - Đại học Y Hà Nội</li>\n<li>Nguyên Bác sĩ điều trị khoa Cơ xương khớp, Bệnh viện Bạch Mai</li>\n<li>Danh hiệu Thầy thuốc Ưu tú Việt Nam</li>\n<li>Tham gia giảng dạy cho các Bác sĩ 15 nước cộng đồng Pháp ngữ</li>\n<li>Trực tiếp giảng dạy cho các sinh viên Nga, Pháp, Úc, Thụy Điển, Ucraina, Mông Cổ bằng 3 ngôn ngữ Nga, Anh, Pháp.</li>\n<li>Thành viên Hội đồng duyệt phác đồ điều trị bệnh lý Cơ Xương Khớp của Bộ Y tế và Bệnh viện Bạch Mai</li>\n<li>Trao đổi kinh nghiệm và tu nghiệp tại trên 30 quốc gia trên thế giới.</li>\n<li>Thường xuyên tham dự các hội nghị của Hội Thấp Khớp học Mỹ (ACR), Hội Thấp Khớp học Châu Âu (EULAR), Hội Thấp Khớp học Châu Á - Thái Bình Dương (APLAR)...</li>\n</ul>\n<p>Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Vĩnh Ngọc đã từng thăm khám, tư vấn và điều trị thành công cho hàng chục nghìn bệnh nhân mắc bệnh Cơ Xương Khớp. Trong số đó có nhiều người là chính khách (Bộ trưởng, Thứ trưởng), Lãnh đạo các Tập đoàn, Doanh nhân, Anh Hùng Lao động và nhiều bệnh nhân nặng về bệnh lý Cơ Xương Khớp cả trong và ngoài nước.</p>\n<h3>Khám &amp; điều trị các bệnh</h3>\n<h4>1. Bệnh về Khớp</h4>\n<ul>\n<li>Gout, Viêm cột sống dính khớp, thoái hóa khớp, viêm khoanh khớp vai</li>\n<li>Đau khớp vai, đau vai gáy, Lupus ban đỏ, đau thắt lưng, đau xương khớp</li>\n<li>Thoát vị đĩa đệm, viêm khớp.</li>\n</ul>\n<h4>2. Bệnh về Xương</h4>\n<ul>\n<li>Loãng xương, đau nhức xương</li>\n<li>Viêm xương, gai xương, vôi hóa cột sống</li>\n<li>Chấn thương thể thao</li>\n</ul>\n<h4>3. Bệnh về Cơ</h4>\n<ul>\n<li>Chứng đau mỏi cơ</li>\n<li>Yếu cơ, Loạn dưỡng cơ</li>\n<li>Viêm cơ, Teo cơ</li>\n</ul>\n<h4>Các triệu chứng - biểu hiện sau</h4>\n<ul>\n<li>(Danh sách các triệu chứng và bệnh lý cơ xương khớp khác)</li>\n</ul>\n', '## Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Vĩnh Ngọc\n\n- Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Vĩnh Ngọc hiện đang là Phó Chủ tịch Hội khớp học Hà Nội\n- Trưởng phân môn khớp - Phó Trưởng bộ môn Nội tổng hợp - Đại học Y Hà Nội\n- Nguyên Bác sĩ điều trị khoa Cơ xương khớp, Bệnh viện Bạch Mai\n- Danh hiệu Thầy thuốc Ưu tú Việt Nam\n- Tham gia giảng dạy cho các Bác sĩ 15 nước cộng đồng Pháp ngữ\n- Trực tiếp giảng dạy cho các sinh viên Nga, Pháp, Úc, Thụy Điển, Ucraina, Mông Cổ bằng 3 ngôn ngữ Nga, Anh, Pháp.\n- Thành viên Hội đồng duyệt phác đồ điều trị bệnh lý Cơ Xương Khớp của Bộ Y tế và Bệnh viện Bạch Mai\n- Trao đổi kinh nghiệm và tu nghiệp tại trên 30 quốc gia trên thế giới.\n- Thường xuyên tham dự các hội nghị của Hội Thấp Khớp học Mỹ (ACR), Hội Thấp Khớp học Châu Âu (EULAR), Hội Thấp Khớp học Châu Á - Thái Bình Dương (APLAR)...\n\nPhó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Vĩnh Ngọc đã từng thăm khám, tư vấn và điều trị thành công cho hàng chục nghìn bệnh nhân mắc bệnh Cơ Xương Khớp. Trong số đó có nhiều người là chính khách (Bộ trưởng, Thứ trưởng), Lãnh đạo các Tập đoàn, Doanh nhân, Anh Hùng Lao động và nhiều bệnh nhân nặng về bệnh lý Cơ Xương Khớp cả trong và ngoài nước.\n\n### Khám & điều trị các bệnh\n\n#### 1. Bệnh về Khớp\n\n- Gout, Viêm cột sống dính khớp, thoái hóa khớp, viêm khoanh khớp vai\n- Đau khớp vai, đau vai gáy, Lupus ban đỏ, đau thắt lưng, đau xương khớp\n- Thoát vị đĩa đệm, viêm khớp.\n\n#### 2. Bệnh về Xương\n\n- Loãng xương, đau nhức xương\n- Viêm xương, gai xương, vôi hóa cột sống\n- Chấn thương thể thao\n\n#### 3. Bệnh về Cơ\n\n- Chứng đau mỏi cơ\n- Yếu cơ, Loạn dưỡng cơ\n- Viêm cơ, Teo cơ\n\n#### Các triệu chứng - biểu hiện sau\n\n- (Danh sách các triệu chứng và bệnh lý cơ xương khớp khác)\n\n', 'Trưởng phân môn khớp, Đại học Y Hà Nội\nNguyên Bác sĩ điều trị khoa Cơ xương khớp, Bệnh viện Bạch Mai\nHiện đang là Phó Chủ tịch Hội khớp học Hà Nội', 25, NULL, NULL, '2023-09-18 14:14:46', '2023-09-24 12:06:19');
