(24, '<h2>Thạc sĩ, Bác sĩ Nguyễn Thị Hoa</h2>\n<ul>\n<li>Hiện là Trưởng khoa Cơ Xương Khớp Bệnh viện Hữu Nghị</li>\n<li>Khám, tư vấn, điều trị các bệnh lý Cơ Xương khớp</li>\n<li>Thực hiện siêu âm khớp</li>\n<li>Bác sĩ nhận khám từ 15 tuổi trở lên (dưới 15 tuổi hỏi ý kiến bác sĩ)</li>\n</ul>\n<h3>Quá trình học tập và công tác</h3>\n<ul>\n<li>Tốt nghiệp bằng giỏi Trường Đại học Y Hà Nội năm 2004</li>\n<li>Đạt giải thưởng sinh viên nghiên cứu khoa học với thành tích xuất sắc</li>\n<li>Tốt nghiệp thạc sĩ Y khoa năm 2011</li>\n<li>Hiện tại đang là nghiên cứu sinh Tiến sĩ chuyên ngành Nội khoa cơ xương khớp</li>\n<li>Tham gia nhiều đề tài nghiên cứu khoa học về: loãng xương, thoái hóa khớp, thoát vị đĩa đệm</li>\n<li>Bác sĩ hiện đang công tác tại Bệnh viện Hữu Nghị</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<ul>\n<li>Các bệnh lý Cơ Xương khớp</li>\n<li>Bệnh loãng xương</li>\n<li>Viêm khớp dạng thấp</li>\n<li>Bệnh Gout cấp và mạn tính</li>\n<li>Viêm cột sống dính khớp</li>\n<li>Đau nhức xương</li>\n<li>Lupus ban đỏ hệ thống</li>\n<li>Điều trị bảo tồn thoái hóa khớp</li>\n<li>Điều trị nội khoa để giảm đau, giảm co cứng cơ, giảm chèn ép</li>\n</ul>\n', '## Thạc sĩ, Bác sĩ Nguyễn Thị Hoa\n\n- Hiện là Trưởng khoa Cơ Xương Khớp Bệnh viện Hữu Nghị\n- Khám, tư vấn, điều trị các bệnh lý Cơ Xương khớp\n- Thực hiện siêu âm khớp\n- Bác sĩ nhận khám từ 15 tuổi trở lên (dưới 15 tuổi hỏi ý kiến bác sĩ)\n\n### Quá trình học tập và công tác\n\n- Tốt nghiệp bằng giỏi Trường Đại học Y Hà Nội năm 2004\n- Đạt giải thưởng sinh viên nghiên cứu khoa học với thành tích xuất sắc\n- Tốt nghiệp thạc sĩ Y khoa năm 2011\n- Hiện tại đang là nghiên cứu sinh Tiến sĩ chuyên ngành Nội khoa cơ xương khớp\n- Tham gia nhiều đề tài nghiên cứu khoa học về: loãng xương, thoái hóa khớp, thoát vị đĩa đệm\n- Bác sĩ hiện đang công tác tại Bệnh viện Hữu Nghị\n\n## Khám và điều trị\n\n- Các bệnh lý Cơ Xương khớp\n- Bệnh loãng xương\n- Viêm khớp dạng thấp\n- Bệnh Gout cấp và mạn tính\n- Viêm cột sống dính khớp\n- Đau nhức xương\n- Lupus ban đỏ hệ thống\n- Điều trị bảo tồn thoái hóa khớp\n- Điều trị nội khoa để giảm đau, giảm co cứng cơ, giảm chèn ép\n', 'Hiện là Trưởng khoa Cơ Xương Khớp Bệnh viện Hữu Nghị\nChuyên gia trong lĩnh vực Nội cơ xương khớp\nBác sĩ nhận khám từ 15 tuổi trở lên (dưới 15 tuổi hỏi ý kiến bác sĩ)', 24, NULL, NULL, '2023-09-18 14:17:26', '2023-09-24 12:05:56'),
(25, '<h2>Bác sĩ Chuyên khoa II Nguyễn Thị Lan</h2>\n<ul>\n<li>Trên 20 năm kinh nghiệm công tác trong chuyên ngành Cơ xương khớp</li>\n<li>Chuyên gia trong chẩn đoán, điều trị các bệnh lý Cơ Xương khớp</li>\n<li>Trưởng khoa Cơ Xương khớp, Bệnh viện Hữu Nghị (2012 - 2019)</li>\n<li>Tốt nghiệp bác sĩ đa khoa trường Đại Học Y Hà Nội (1989)</li>\n<li>Bác sĩ chuyên khoa II (2003)</li>\n<li>Thành viên trong ban chấp hành hội loãng xương và hội thấp khớp học Hà Nội (2012 - 2016)</li>\n<li>Tham gia nhiều đề tài nghiên cứu khoa học về các bệnh cơ xương khớp như: loãng xương, viêm khớp dạng thấp</li>\n<li>Bác sĩ nhận khám từ 15 tuổi trở lên (dưới 15 tuổi hỏi ý kiến bác sĩ)</li>\n</ul>\n<h3>Bác sĩ khám và điều trị</h3>\n<ul>\n<li>Các bệnh lý Cơ Xương khớp</li>\n<li>Bệnh loãng xương</li>\n<li>Viêm khớp dạng thấp</li>\n<li>Bệnh Gout cấp và mạn tính</li>\n<li>Viêm cột sống dính khớp</li>\n<li>Đau nhức xương</li>\n<li>Lupus ban đỏ hệ thống</li>\n<li>Điều trị bảo tồn thoái hóa khớp</li>\n<li>Áp liệu pháp vật lí trị liệu</li>\n<li>Điều trị nội khoa để giảm đau, giảm co cứng cơ, giảm chèn ép</li>\n</ul>\n<h3>Bệnh Loãng Xương</h3>\n<ul>\n<li>Loãng xương được đặc trưng bởi sự thay đổi sức mạnh của xương. Sức mạnh này được đặc trưng bởi mật độ xương và chất lượng của xương.</li>\n<li>Chất lượng xương được đánh giá bởi các thông số: cấu trúc xương, chu chuyển xương, độ khoáng xương, tổn thương tích lũy, tính chất của các chất cơ bản của xương.</li>\n</ul>\n<h3>Triệu chứng</h3>\n<ul>\n<li>Thông thường, loãng xương không gây đau, không có bất cứ biểu hiện lâm sàng nào. Các triệu chứng đầu tiên có thể là biểu hiện biến chứng của loãng xương.</li>\n<li>Thay đổi chiều cao, hình thái: gây giảm chiều cao theo năm tháng, xẹp đốt sống, rối loạn tư thế sống, gãy xương.</li>\n</ul>\n<h3>Xét nghiệm chẩn đoán</h3>\n<ul>\n<li>Chụp X.Quang (không có tác dụng chẩn đoán sớm loãng xương).</li>\n<li>Xét nghiệm máu (tốc độ máu lắng, CRP, điện di protein máu...).</li>\n<li>Đo mật độ xương bằng máy DEXA (năng lượng kép hấp thu tia X) mới có giá trị chẩn đoán.</li>\n</ul>\n', '## Bác sĩ Chuyên khoa II Nguyễn Thị Lan\n\n- Trên 20 năm kinh nghiệm công tác trong chuyên ngành Cơ xương khớp\n- Chuyên gia trong chẩn đoán, điều trị các bệnh lý Cơ Xương khớp\n- Trưởng khoa Cơ Xương khớp, Bệnh viện Hữu Nghị (2012 - 2019)\n- Tốt nghiệp bác sĩ đa khoa trường Đại Học Y Hà Nội (1989)\n- Bác sĩ chuyên khoa II (2003)\n- Thành viên trong ban chấp hành hội loãng xương và hội thấp khớp học Hà Nội (2012 - 2016)\n- Tham gia nhiều đề tài nghiên cứu khoa học về các bệnh cơ xương khớp như: loãng xương, viêm khớp dạng thấp\n- Bác sĩ nhận khám từ 15 tuổi trở lên (dưới 15 tuổi hỏi ý kiến bác sĩ)\n\n### Bác sĩ khám và điều trị\n\n- Các bệnh lý Cơ Xương khớp\n- Bệnh loãng xương\n- Viêm khớp dạng thấp\n- Bệnh Gout cấp và mạn tính\n- Viêm cột sống dính khớp\n- Đau nhức xương\n- Lupus ban đỏ hệ thống\n- Điều trị bảo tồn thoái hóa khớp\n- Áp liệu pháp vật lí trị liệu\n- Điều trị nội khoa để giảm đau, giảm co cứng cơ, giảm chèn ép\n\n### Bệnh Loãng Xương\n\n- Loãng xương được đặc trưng bởi sự thay đổi sức mạnh của xương. Sức mạnh này được đặc trưng bởi mật độ xương và chất lượng của xương.\n- Chất lượng xương được đánh giá bởi các thông số: cấu trúc xương, chu chuyển xương, độ khoáng xương, tổn thương tích lũy, tính chất của các chất cơ bản của xương.\n\n### Triệu chứng\n\n- Thông thường, loãng xương không gây đau, không có bất cứ biểu hiện lâm sàng nào. Các triệu chứng đầu tiên có thể là biểu hiện biến chứng của loãng xương.\n- Thay đổi chiều cao, hình thái: gây giảm chiều cao theo năm tháng, xẹp đốt sống, rối loạn tư thế sống, gãy xương.\n\n### Xét nghiệm chẩn đoán\n\n- Chụp X.Quang (không có tác dụng chẩn đoán sớm loãng xương).\n- Xét nghiệm máu (tốc độ máu lắng, CRP, điện di protein máu...).\n- Đo mật độ xương bằng máy DEXA (năng lượng kép hấp thu tia X) mới có giá trị chẩn đoán.\n\n', 'Nguyên Trưởng khoa Cơ xương khớp, Bệnh viện Hữu Nghị\nTrên 20 năm kinh nghiệm công tác trong chuyên ngành Cơ xương khớp\nBác sĩ nhận khám từ 15 tuổi trở lên (dưới 15 tuổi hỏi ý kiến bác sĩ)', 23, NULL, NULL, '2023-09-18 14:18:41', '2023-09-24 11:41:41'),
(26, '<h2>Bác sĩ Chuyên khoa II Hà Quốc Hùng</h2>\n<ul>\n<li>Gần 30 năm kinh nghiệm khám và điều trị chuyên sâu về các bệnh lý Nội khoa - Cơ xương khớp cho người cao tuổi</li>\n<li>Hiện đang là Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương</li>\n<li>Nguyên giảng viên bộ môn Lão khoa, Đại học Y Hà Nội</li>\n<li>Bác sĩ nhận khám từ 18 tuổi trở lên</li>\n</ul>\n<h3>Khám và điều trị</h3>\n<p>Bác sĩ khám và điều trị chuyên sâu về các bệnh lý nội khoa cho người cao tuổi, bao gồm:</p>\n<ul>\n<li>Bệnh lý cơ xương khớp: loãng xương, thoái hóa khớp, thoát vị đĩa đệm,...</li>\n<li>Tiêu hóa: Đau dạ dày, trào ngược dạ dày,...</li>\n<li>Tim mạch: Tăng huyết áp, rối loạn chuyển hóa,...</li>\n<li>Đái tháo đường</li>\n<li>Parkinson</li>\n<li>Tai biến mạch máu não</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Giảng viên bộ môn Lão khoa, Đại học Y Hà Nội (1998 - 2006)</li>\n<li>Trưởng khoa Nội tổng hợp, Bệnh viện Lão khoa Trung ương (2007 - 7/2013)</li>\n<li>Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương (8/2013 - nay)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Học Bác sĩ Đa khoa, Đại học Y Hà Nội (1987 - 1993)</li>\n<li>Bác sĩ Nội trú bệnh viện, Đại học Y Hà Nội - Bệnh viện Bạch Mai (1994 - 1997)</li>\n</ul>\n<h3>Chứng chỉ trong nước hoặc nước ngoài</h3>\n<ul>\n<li>Bằng Thạc sĩ Y khoa, Đại học Y Hà Nội</li>\n<li>Bằng Bác sĩ Chuyên khoa I chuyên ngành Nội chung, Đại học Y Hà Nội</li>\n</ul>\n<h3>Thành viên các Hội khoa học, tổ chức chuyên môn</h3>\n<ul>\n<li>Thành viên Hội Tiết niệu thận học Hà Nội</li>\n</ul>\n<h3>Tham gia các chuyên đề sức khỏe trên báo chí, truyền hình</h3>\n<ul>\n<li>Tham gia các chuyên đề sức khỏe lão khoa trên kênh VOV, VTV</li>\n</ul>\n', '## Bác sĩ Chuyên khoa II Hà Quốc Hùng\n\n- Gần 30 năm kinh nghiệm khám và điều trị chuyên sâu về các bệnh lý Nội khoa - Cơ xương khớp cho người cao tuổi\n- Hiện đang là Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương\n- Nguyên giảng viên bộ môn Lão khoa, Đại học Y Hà Nội\n- Bác sĩ nhận khám từ 18 tuổi trở lên\n\n### Khám và điều trị\n\nBác sĩ khám và điều trị chuyên sâu về các bệnh lý nội khoa cho người cao tuổi, bao gồm:\n\n- Bệnh lý cơ xương khớp: loãng xương, thoái hóa khớp, thoát vị đĩa đệm,...\n- Tiêu hóa: Đau dạ dày, trào ngược dạ dày,...\n- Tim mạch: Tăng huyết áp, rối loạn chuyển hóa,...\n- Đái tháo đường\n- Parkinson\n- Tai biến mạch máu não\n\n### Quá trình công tác\n\n- Giảng viên bộ môn Lão khoa, Đại học Y Hà Nội (1998 - 2006)\n- Trưởng khoa Nội tổng hợp, Bệnh viện Lão khoa Trung ương (2007 - 7/2013)\n- Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương (8/2013 - nay)\n\n### Quá trình đào tạo\n\n- Học Bác sĩ Đa khoa, Đại học Y Hà Nội (1987 - 1993)\n- Bác sĩ Nội trú bệnh viện, Đại học Y Hà Nội - Bệnh viện Bạch Mai (1994 - 1997)\n\n### Chứng chỉ trong nước hoặc nước ngoài\n\n- Bằng Thạc sĩ Y khoa, Đại học Y Hà Nội\n- Bằng Bác sĩ Chuyên khoa I chuyên ngành Nội chung, Đại học Y Hà Nội\n\n### Thành viên các Hội khoa học, tổ chức chuyên môn\n\n- Thành viên Hội Tiết niệu thận học Hà Nội\n\n### Tham gia các chuyên đề sức khỏe trên báo chí, truyền hình\n\n- Tham gia các chuyên đề sức khỏe lão khoa trên kênh VOV, VTV\n', 'Gần 30 năm kinh nghiệm khám và điều trị chuyên sâu về các bệnh lý Nội khoa - Cơ xương khớp cho người cao tuổi\nHiện đang là Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương\nNguyên giảng viên bộ môn Lão khoa, Đại học Y Hà Nội\nBác sĩ nhận khám từ 18 tuổi trở lên', 26, NULL, NULL, '2023-09-18 14:42:09', '2023-09-24 12:06:30'),
(27, '<h2>Bác sĩ Chuyên khoa II Hoàng Thị Bích</h2>\n<ul>\n<li>Gần 20 năm kinh nghiệm trong lĩnh vực Nội cơ xương khớp</li>\n<li>Bác sĩ hiện đang công tác tại Bệnh viện Lão Khoa Trung ương</li>\n</ul>\n<h3>Khám và điều trị</h3>\n<p>Bác sĩ khám và điều trị chuyên sâu về Nội Cơ Xương Khớp:</p>\n<ul>\n<li>Loãng xương: Đau dọc xương dài, đau nhức xương, gù, vẹo cột sống hoặc không triệu chứng</li>\n<li>Gút: Sưng đau khớp, lắng đọng acid uric</li>\n<li>Thoát vị đĩa đệm: Đau vai gáy, đau cột sống cổ, đau cột sống ngực – thắt lưng lan xuống tay, chân, đi lại khó khăn</li>\n<li>Viêm quanh khớp vai: Vận động khớp vai khó khăn, hạn chế giơ cao tay hoặc giang ngang tay, xoay vai khó khăn</li>\n<li>Bệnh lý phần mềm quanh khớp: Đau quanh các khớp, hạn chế vận động khớp</li>\n<li>Thoái hóa khớp gối: Đau khớp gối khi vận động, tràn dịch khớp gối,…</li>\n<li>Thoái hóa đa khớp: Đau nhiều khớp khi vận động</li>\n<li>Viêm khớp dạng thấp: Sưng đau nhiều khớp, vận động khó khăn, cứng khớp buổi sáng hoặc cả ngày</li>\n<li>Viêm cột sống dính khớp: Đau lưng, đau khớp háng hoặc gối</li>\n<li>Viêm da cơ, viêm đa cơ: Yếu cơ gốc chi, ban cánh hồi trên da, tăng men cơ</li>\n<li>Lupus ban đỏ hệ thống: Đau nhiều khớp, ban đỏ hình cánh bướm vùng mặt</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Bác sĩ điều trị - Bệnh viện Lão Khoa Trung ương (04/2016 - nay)</li>\n<li>Bác sĩ điều trị - Bệnh viện Hữu Nghị Đa khoa Nghệ An (08/2004 - 04/2016)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Bác sĩ Chuyên khoa cấp II Nội Xương Khớp - Đại học Y Hà Nội (2019 - 2021)</li>\n<li>Thạc sĩ Nội khoa - Đại học Y Hà Nội (2011 - 2013)</li>\n<li>Bác sĩ Đa Khoa - Đại học Y Hà Nội (1998 - 2004)</li>\n</ul>\n<h3>Chứng chỉ trong nước hoặc nước ngoài</h3>\n<ul>\n<li>Bác sĩ gia đình - Đại Y Hà Nội (2022)</li>\n<li>Siêu âm khớp - Đại học Y Dược TP. HCM (2022)</li>\n<li>Siêu âm cơ bản - Bệnh viện Bạch Mai (2012)</li>\n<li>Tiêm khớp - Bệnh viện Bạch Mai (2012)</li>\n</ul>\n<h3>Giải thưởng</h3>\n<ul>\n<li>Bằng khen của bộ trưởng Bộ Y tế (2021)</li>\n<li>Chiến sĩ thi đua cấp cơ sở (2014, 2019, 2020)</li>\n</ul>\n<h3>Sách và các công trình nghiên cứu, báo cáo khoa học</h3>\n<ul>\n<li>Một số yếu tố liên quan tới mật độ xương ở người bệnh cao tuổi tại Bệnh viện Lão khoa Trung ương (2021)</li>\n<li>Mối liên quan giữa mật độ xương và bề dày lớp nội trung mạc động mạch cảnh ở bệnh nhân ≥ 60 tuổi tại Bệnh viện Lão Khoa Trung ương (2021)</li>\n<li>Đánh giá hiệu quả và tính an toàn của Acid Zoledronic (Aclasta) sau 1 năm điều trị loãng xương ở bệnh nhân điều trị nội trú tại khoa Nội Tiết và Cơ Xương Khớp Bệnh viện Lão Khoa Trung ương (2020)</li>\n<li>Khảo sát thực trạng thiếu vitamin D ở bệnh nhân điều trị nội trú tại khoa Nội Tiết và Cơ Xương Khớp Bệnh viện Lão Khoa Trung ương (2019)</li>\n<li>Dự báo xác suất gãy xương theo mô hình FRAX ở phụ nữ miền bắc Việt Nam từ 60 tuổi trở lên (2014)</li>\n<li>Khảo sát yếu tố nguy cơ loãng xương ở phụ nữ miền bắc Việt Nam từ 60 tuổi trở lên (2014)</li>\n<li>Nghiên cứu các yếu tố nguy cơ loãng xương và dự báo xác suất gẫy xương theo mô hình Garvan và FRAX ở phụ nữ từ 60 tuổi trở lên (2013)</li>\n<li>Một số đặc điểm của hạ huyết áp tư thế đứng trên bệnh nhân đái</li>\n</ul>\n', '## Bác sĩ Chuyên khoa II Hoàng Thị Bích\n\n- Gần 20 năm kinh nghiệm trong lĩnh vực Nội cơ xương khớp\n- Bác sĩ hiện đang công tác tại Bệnh viện Lão Khoa Trung ương\n\n### Khám và điều trị\n\nBác sĩ khám và điều trị chuyên sâu về Nội Cơ Xương Khớp:\n\n- Loãng xương: Đau dọc xương dài, đau nhức xương, gù, vẹo cột sống hoặc không triệu chứng\n- Gút: Sưng đau khớp, lắng đọng acid uric\n- Thoát vị đĩa đệm: Đau vai gáy, đau cột sống cổ, đau cột sống ngực – thắt lưng lan xuống tay, chân, đi lại khó khăn\n- Viêm quanh khớp vai: Vận động khớp vai khó khăn, hạn chế giơ cao tay hoặc giang ngang tay, xoay vai khó khăn\n- Bệnh lý phần mềm quanh khớp: Đau quanh các khớp, hạn chế vận động khớp\n- Thoái hóa khớp gối: Đau khớp gối khi vận động, tràn dịch khớp gối,…\n- Thoái hóa đa khớp: Đau nhiều khớp khi vận động\n- Viêm khớp dạng thấp: Sưng đau nhiều khớp, vận động khó khăn, cứng khớp buổi sáng hoặc cả ngày\n- Viêm cột sống dính khớp: Đau lưng, đau khớp háng hoặc gối\n- Viêm da cơ, viêm đa cơ: Yếu cơ gốc chi, ban cánh hồi trên da, tăng men cơ\n- Lupus ban đỏ hệ thống: Đau nhiều khớp, ban đỏ hình cánh bướm vùng mặt\n\n### Quá trình công tác\n\n- Bác sĩ điều trị - Bệnh viện Lão Khoa Trung ương (04/2016 - nay)\n- Bác sĩ điều trị - Bệnh viện Hữu Nghị Đa khoa Nghệ An (08/2004 - 04/2016)\n\n### Quá trình đào tạo\n\n- Bác sĩ Chuyên khoa cấp II Nội Xương Khớp - Đại học Y Hà Nội (2019 - 2021)\n- Thạc sĩ Nội khoa - Đại học Y Hà Nội (2011 - 2013)\n- Bác sĩ Đa Khoa - Đại học Y Hà Nội (1998 - 2004)\n\n### Chứng chỉ trong nước hoặc nước ngoài\n\n- Bác sĩ gia đình - Đại Y Hà Nội (2022)\n- Siêu âm khớp - Đại học Y Dược TP. HCM (2022)\n- Siêu âm cơ bản - Bệnh viện Bạch Mai (2012)\n- Tiêm khớp - Bệnh viện Bạch Mai (2012)\n\n### Giải thưởng\n\n- Bằng khen của bộ trưởng Bộ Y tế (2021)\n- Chiến sĩ thi đua cấp cơ sở (2014, 2019, 2020)\n\n### Sách và các công trình nghiên cứu, báo cáo khoa học\n\n- Một số yếu tố liên quan tới mật độ xương ở người bệnh cao tuổi tại Bệnh viện Lão khoa Trung ương (2021)\n- Mối liên quan giữa mật độ xương và bề dày lớp nội trung mạc động mạch cảnh ở bệnh nhân ≥ 60 tuổi tại Bệnh viện Lão Khoa Trung ương (2021)\n- Đánh giá hiệu quả và tính an toàn của Acid Zoledronic (Aclasta) sau 1 năm điều trị loãng xương ở bệnh nhân điều trị nội trú tại khoa Nội Tiết và Cơ Xương Khớp Bệnh viện Lão Khoa Trung ương (2020)\n- Khảo sát thực trạng thiếu vitamin D ở bệnh nhân điều trị nội trú tại khoa Nội Tiết và Cơ Xương Khớp Bệnh viện Lão Khoa Trung ương (2019)\n- Dự báo xác suất gãy xương theo mô hình FRAX ở phụ nữ miền bắc Việt Nam từ 60 tuổi trở lên (2014)\n- Khảo sát yếu tố nguy cơ loãng xương ở phụ nữ miền bắc Việt Nam từ 60 tuổi trở lên (2014)\n- Nghiên cứu các yếu tố nguy cơ loãng xương và dự báo xác suất gẫy xương theo mô hình Garvan và FRAX ở phụ nữ từ 60 tuổi trở lên (2013)\n- Một số đặc điểm của hạ huyết áp tư thế đứng trên bệnh nhân đái\n', 'Gần 20 năm kinh nghiệm trong lĩnh vực Nội Cơ Xương Khớp\nBác sĩ hiện đang công tác tại Bệnh viện Lão Khoa Trung ương\nBác sĩ nhận khám bệnh nhân ở mọi độ tuổi', 27, NULL, NULL, '2023-09-18 14:43:25', '2023-09-18 14:43:25'),
(28, '<h2>Tiến sĩ, Bác sĩ Phạm Chí Lăng</h2>\n<ul>\n<li>Hơn 30 năm kinh nghiệm trong lĩnh vực Cơ xương khớp - Chấn thương chỉnh hình</li>\n<li>Từng công tác tại các bệnh viện lớn như: Bệnh viện Chợ Rẫy, Bệnh viện Chấn thương chỉnh hình TP.HCM, Bệnh viện Pháp Việt (FV)</li>\n<li>Giảng viên tại nhiều trường đại học y khoa nổi tiếng như: Đại học Y Dược TP.HCM, Đại học Y Phạm Ngọc Thạch, khoa Y trường Đại học Quốc Gia TP.HCM,...</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Hiện là Trưởng khoa Chấn thương chỉnh hình, Bệnh viện Quốc tế City (2013 - nay)</li>\n<li>Giảng viên bộ môn Chấn thương chỉnh hình, Đại học Y khoa Phạm Ngọc Thạch, Giảng viên bộ môn Ngoại – Khoa Y, Đại học Quốc gia TP.HCM (2013 - nay)</li>\n<li>Bác sĩ phẫu thuật Chấn thương chỉnh hình, Bệnh viện Pháp Việt (FV) (2002 - 2013)</li>\n<li>Bác sĩ điều trị khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP.HCM (1993 - 2002)</li>\n<li>Bác sĩ điều trị khoa Chấn thương chỉnh hình, Bệnh viện Chợ Rẫy (1986 - 1993)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Tốt nghiệp Bác sĩ tại Đại học Y dược TPHCM (1986)</li>\n<li>Tốt nghiệp Thạc sĩ chuyên ngành Chấn thương chỉnh hình, Đại học Y Dược TP.HCM (2002)</li>\n<li>Tốt nghiệp Tiến sĩ chuyên ngành Chấn thương chỉnh hình Đại học Y Dược TP.HCM (2011)</li>\n<li>Tốt nghiệp lớp đào tạo nội trú chuyên khoa Chấn thương chỉnh hình tại trường Đại học Y khoa Bordeaux 2, Pháp (1995)</li>\n<li>Bác sĩ nội trú khoa Chấn thương chỉnh hình Bệnh viện DAX, Bordeaux, Pháp (1995)</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<p>Bác sĩ Phạm Chí Lăng chuyên khám và điều trị các vấn đề sau:</p>\n<ul>\n<li>Chấn thương khớp gối, vai, cột sống (trong tai nạn sinh hoạt, chấn thương thể thao)</li>\n<li>Đứt dây chằng gối, dẹp rách sụn gối - trật khớp vai</li>\n<li>Chấn thương đứt dây chằng khớp gối</li>\n<li>Chấn thương rách đứt dây chằng cổ chân</li>\n<li>Chấn thương rách lật khớp vai</li>\n<li>Chấn thương rách gân khớp vai</li>\n<li>Thoái hóa khớp gối, cột sống cổ …</li>\n<li>Các bệnh lý đặc biệt trong thể thao</li>\n<li>Bệnh thoái hóa cột sống cổ tay đĩa đệm</li>\n<li>Bệnh lý khớp gối</li>\n<li>Hội chứng Tennis Elbow (viêm lồi cầu ngoài xương cánh tay là chấn thương thường gặp ở người chơi tennis)</li>\n<li>Gai gót chân</li>\n<li>Bệnh lý gối lệch trục xương ( vẹo trong , vẹo ngoài )</li>\n<li>Thoái hóa khớp háng</li>\n</ul>\n', '## Tiến sĩ, Bác sĩ Phạm Chí Lăng\n\n- Hơn 30 năm kinh nghiệm trong lĩnh vực Cơ xương khớp - Chấn thương chỉnh hình\n- Từng công tác tại các bệnh viện lớn như: Bệnh viện Chợ Rẫy, Bệnh viện Chấn thương chỉnh hình TP.HCM, Bệnh viện Pháp Việt (FV)\n- Giảng viên tại nhiều trường đại học y khoa nổi tiếng như: Đại học Y Dược TP.HCM, Đại học Y Phạm Ngọc Thạch, khoa Y trường Đại học Quốc Gia TP.HCM,...\n\n### Quá trình công tác\n\n- Hiện là Trưởng khoa Chấn thương chỉnh hình, Bệnh viện Quốc tế City (2013 - nay)\n- Giảng viên bộ môn Chấn thương chỉnh hình, Đại học Y khoa Phạm Ngọc Thạch, Giảng viên bộ môn Ngoại – Khoa Y, Đại học Quốc gia TP.HCM (2013 - nay)\n- Bác sĩ phẫu thuật Chấn thương chỉnh hình, Bệnh viện Pháp Việt (FV) (2002 - 2013)\n- Bác sĩ điều trị khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP.HCM (1993 - 2002)\n- Bác sĩ điều trị khoa Chấn thương chỉnh hình, Bệnh viện Chợ Rẫy (1986 - 1993)\n\n### Quá trình đào tạo\n\n- Tốt nghiệp Bác sĩ tại Đại học Y dược TPHCM (1986)\n- Tốt nghiệp Thạc sĩ chuyên ngành Chấn thương chỉnh hình, Đại học Y Dược TP.HCM (2002)\n- Tốt nghiệp Tiến sĩ chuyên ngành Chấn thương chỉnh hình Đại học Y Dược TP.HCM (2011)\n- Tốt nghiệp lớp đào tạo nội trú chuyên khoa Chấn thương chỉnh hình tại trường Đại học Y khoa Bordeaux 2, Pháp (1995)\n- Bác sĩ nội trú khoa Chấn thương chỉnh hình Bệnh viện DAX, Bordeaux, Pháp (1995)\n\n## Khám và điều trị\n\nBác sĩ Phạm Chí Lăng chuyên khám và điều trị các vấn đề sau:\n\n- Chấn thương khớp gối, vai, cột sống (trong tai nạn sinh hoạt, chấn thương thể thao)\n- Đứt dây chằng gối, dẹp rách sụn gối - trật khớp vai\n- Chấn thương đứt dây chằng khớp gối\n- Chấn thương rách đứt dây chằng cổ chân\n- Chấn thương rách lật khớp vai\n- Chấn thương rách gân khớp vai\n- Thoái hóa khớp gối, cột sống cổ …\n- Các bệnh lý đặc biệt trong thể thao\n- Bệnh thoái hóa cột sống cổ tay đĩa đệm\n- Bệnh lý khớp gối\n- Hội chứng Tennis Elbow (viêm lồi cầu ngoài xương cánh tay là chấn thương thường gặp ở người chơi tennis)\n- Gai gót chân\n- Bệnh lý gối lệch trục xương ( vẹo trong , vẹo ngoài )\n- Thoái hóa khớp háng\n', 'Hơn 30 năm kinh nghiệm trong lĩnh vực Cơ xương khớp - Chấn thương chỉnh hình\nTừng công tác tại các bệnh viện lớn như: Bệnh viện Chợ Rẫy, Bệnh viện Chấn thương chỉnh hình TP.HCM, Bệnh viện Pháp Việt (FV)\nGiảng viên tại nhiều trường đại học y khoa nổi tiếng như: Đại học Y Dược TP.HCM, Đại học Y Phạm Ngọc Thạch, khoa Y trường Đại học Quốc Gia TP.HCM,...', 29, NULL, NULL, '2023-09-18 15:02:18', '2023-09-18 15:02:18'),
(29, '<h2>Bác sĩ Phạm Trọng Nghĩa</h2>\n<ul>\n<li>Bác sĩ đang công tác tại Phòng khám Đa khoa Quốc tế Nhân Hậu</li>\n<li>Bác sĩ điều trị cơ xương khớp bằng các phương pháp kết hợp y học hiện đại và y học cổ truyền</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Hiện là Bác sĩ khám và điều trị tại Phòng khám Đa khoa Quốc tế Nhân Hậu (2017 - nay)</li>\n<li>Bác sĩ tại Bệnh viện Phục hồi chức năng và Bệnh nghề nghiệp Quận 8 (2015 - 2017)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Tốt nghiệp Bác sĩ Y học cổ truyền, Đại học Y dược TP.HCM (2014)</li>\n<li>Tốt nghiệp Bác sĩ chuyên ngành Nội Tổng hợp, Đại học Y dược Thái Bình (2015)</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<p><strong>Bác sĩ khám và điều trị các mặt bệnh liên quan đến cơ xương khớp:</strong></p>\n<ul>\n<li>Thoái hóa cột sống cổ, cột sống thắt lưng</li>\n<li>Hội chứng ống cổ tay</li>\n<li>Bệnh gout</li>\n<li>Thoái hóa khớp</li>\n<li>Viêm khớp dạng thấp</li>\n</ul>\n', '## Bác sĩ Phạm Trọng Nghĩa\n\n- Bác sĩ đang công tác tại Phòng khám Đa khoa Quốc tế Nhân Hậu\n- Bác sĩ điều trị cơ xương khớp bằng các phương pháp kết hợp y học hiện đại và y học cổ truyền\n\n### Quá trình công tác\n\n- Hiện là Bác sĩ khám và điều trị tại Phòng khám Đa khoa Quốc tế Nhân Hậu (2017 - nay)\n- Bác sĩ tại Bệnh viện Phục hồi chức năng và Bệnh nghề nghiệp Quận 8 (2015 - 2017)\n\n### Quá trình đào tạo\n\n- Tốt nghiệp Bác sĩ Y học cổ truyền, Đại học Y dược TP.HCM (2014)\n- Tốt nghiệp Bác sĩ chuyên ngành Nội Tổng hợp, Đại học Y dược Thái Bình (2015)\n\n## Khám và điều trị\n\n**Bác sĩ khám và điều trị các mặt bệnh liên quan đến cơ xương khớp:**\n\n- Thoái hóa cột sống cổ, cột sống thắt lưng\n- Hội chứng ống cổ tay\n- Bệnh gout\n- Thoái hóa khớp\n- Viêm khớp dạng thấp\n', 'Bác sĩ đang công tác tại Phòng khám Đa khoa Quốc tế Nhân Hậu\nBác sĩ điều trị cơ xương khớp bằng các phương pháp kết hợp y học hiện đại và y học cổ truyền', 28, NULL, NULL, '2023-09-18 15:03:23', '2023-09-18 15:03:23');
